import os
import time
import shutil
import pystray
from PIL import Image
import base64
from io import BytesIO
from threading import Thread
from tkinter import Toplevel, Tk, StringVar, filedialog, Label, Button, messagebox, filedialog, ttk, Entry, RAISED
import tkinter as tk
import threading
import json
import sys

SETTINGS_FILE = "settings.json"
LOG_FILE = "move_files.log"

# Путь к папке, из которой нужно перемещать файлы
move_from_path = ""
# Путь к папке, в которую нужно перемещать файлы
move_to_path = ""

# Флаги для вывода информации в консоль
log_flag = True

def save_settings():
    settings = {
        "move_from_path": move_from_path,
        "move_to_path": move_to_path
    }
    with open(SETTINGS_FILE, "w") as f:
        json.dump(settings, f)

# В функции load_settings(), добавим проверку, что файл существует
def load_settings():
    global move_from_path, move_to_path
    if os.path.exists(SETTINGS_FILE):
        with open(SETTINGS_FILE, "r") as f:
            try:
                settings = json.load(f)
                move_from_path = settings.get("move_from_path", "")
                move_to_path = settings.get("move_to_path", "")
            except json.decoder.JSONDecodeError:
                move_from_path = ""
                move_to_path = ""
    else:
        # Если файл настроек не существует, устанавливаем пустые значения для путей
        move_from_path = ""
        move_to_path = ""

def check_settings_file():
    if not os.path.exists(SETTINGS_FILE):
        with open(SETTINGS_FILE, "w") as f:
            # Создаем пустой файл settings.json
            pass

def check_log_file():
    if not os.path.exists(LOG_FILE):
        with open(LOG_FILE, "w") as f:
            # Создаем пустой файл move_files.log
            pass
            
def move_files():
    global move_from_path, move_to_path
    if os.path.isdir(move_from_path):
        # Получаем список файлов в папке для перемещения
        files = os.listdir(move_from_path)
        # Перемещаем каждый файл в папку назначения
        for file in files:
            src_path = os.path.join(move_from_path, file)
            dest_path = os.path.join(move_to_path, file)
            # Проверяем, существует ли файл с таким же именем в папке назначения
            if os.path.exists(dest_path):
                # Если файл существует, генерируем новое уникальное имя для текущего файла
                new_name = file
                counter = 1
                while os.path.exists(os.path.join(move_to_path, new_name)):
                    name, ext = os.path.splitext(file)
                    new_name = f"{name}_{counter}{ext}"
                    counter += 1
                dest_path = os.path.join(move_to_path, new_name)
            try:
                shutil.move(src_path, dest_path)
                log(f"File '{file}' has been moved to {move_to_path} as '{os.path.basename(dest_path)}'")
            except Exception as e:
                log(f"Error moving file '{file}': {e}")
    else:
        log(f"Source path '{move_from_path}' is not a valid directory.")

def periodic_move_files():
    while True:
        move_files()
        # Задержка на 60 секунд перед следующей итерацией
        time.sleep(60)

def on_quit(icon, item):
    icon.stop()
    os._exit(0)  # Используем os._exit(0) вместо sys.exit() для выхода из приложения без генерации исключения

# Функция для логирования действий
def log(message):
    if log_flag:
        print(message)
        with open("move_files.log", "a") as log_file:
            log_file.write(message + "\n")

def choose_folder(var, prompt):
    def select_folder(var):
        root = tk.Tk()
        root.withdraw()  # Скрыть корневое окно
        folder_path = filedialog.askdirectory(parent=root)
        root.destroy()
        if folder_path:
            var.set(folder_path)
            print(f"Selected '{prompt}' folder:", folder_path)
    threading.Thread(target=select_folder, args=(var,)).start()

# Определение окна выбора папок
def show_folder_selection_window():
    folder_selection_window = Tk()
    folder_selection_window.title("Select Folders")
    folder_selection_window.geometry("500x300")
    
    # Темный фон для окна
    folder_selection_window.configure(bg="#34495E")
    
    # Цвета для стилизации
    title_color = "#EAECEE"
    label_color = "#ECF0F1"
    entry_color = "#BDC3C7"
    button_color = "#85C1E9"
    
    # Эффект выпуклости для окна
    folder_selection_window.attributes('-alpha', 0.95)
    folder_selection_window.attributes('-topmost', True)

    # Создаем виджеты и кнопки для выбора папок
    Label(folder_selection_window, text="Move files from:", fg=title_color, bg="#34495E").pack(pady=(10, 1))
    from_var = StringVar(folder_selection_window)
    Entry(folder_selection_window, textvariable=from_var, bg=entry_color, width=60).pack(pady=(1, 1))
    Button(folder_selection_window, text="Select Folder", bg=button_color, relief=RAISED, command=lambda: choose_folder(from_var, "Move files from")).pack(pady=(1, 1))

    Label(folder_selection_window, text="Move files into:", fg=title_color, bg="#34495E").pack(pady=(10, 1))
    to_var = StringVar(folder_selection_window)
    Entry(folder_selection_window, textvariable=to_var, bg=entry_color, width=60).pack(pady=(1, 1))
    Button(folder_selection_window, text="Select Folder", bg=button_color, relief=RAISED, command=lambda: choose_folder(to_var, "Move files into")).pack(pady=(1, 1))

    Button(folder_selection_window, text="Start", bg=button_color, relief=RAISED, command=lambda: start_program(from_var.get(), to_var.get(), folder_selection_window)).pack(pady=(30, 10))

    # Кнопка для закрытия окна
    Button(folder_selection_window, text="Close", bg=button_color, relief=RAISED, command=folder_selection_window.destroy).pack(pady=(10, 1))

    # Отображение "Please select a folder..." изначально
    if move_from_path:
        from_var.set(move_from_path)
    else:
        from_var.set("Please select a folder...")

    if move_to_path:
        to_var.set(move_to_path)
    else:
        to_var.set("Please select a folder...")
    
    # Отображение сохраненных путей
    from_var.set(move_from_path)
    to_var.set(move_to_path)
    
    folder_selection_window.mainloop()

def start_program(from_path, to_path, parent):
    global move_from_path, move_to_path
    if from_path and to_path:
        move_from_path = from_path
        move_to_path = to_path
        save_settings()  # Сохраняем выбранные папки в файл настроек
    else:
        load_settings()  # Загружаем настройки из файла, если пути не указаны
    print("Start program with paths:")
    print("move_from_path:", move_from_path)
    print("move_to_path:", move_to_path)
    if move_from_path and move_to_path:
        # Запускаем поток для периодического перемещения файлов,
        # только если он еще не был запущен
        if not threading.enumerate():
            threading.Thread(target=periodic_move_files).start()
        # Теперь после установки путей вызываем move_files() для первоначального перемещения файлов
        move_files()
        parent.destroy()
    else:
        messagebox.showwarning("Error", "Please select both source and destination folders.")


def show_main_window():
    load_settings()  # Загружаем настройки перед выводом окна
    print("move_from_path:", move_from_path)
    print("move_to_path:", move_to_path)
    check_settings_file()
    check_log_file()
    # Теперь после загрузки настроек вызываем move_files() для первоначального перемещения файлов
    move_files()
    icon = create_icon()
    icon.run()

# Функция для отображения лога
def view_log(icon):
    log_file = "move_files.log"
    if os.path.exists(log_file):
        os.startfile(log_file)
    else:
        print("Log file not found.")

# Функция для открытия папки назначения
def open_destination_folder(icon):
    if os.path.exists(move_to_path):
        os.startfile(move_to_path)
    else:
        print("Destination folder not found.")

# Функция для создания иконки в трее с меню
def create_icon():
    # Загружаем изображение иконки из base64 строки
    base64_icon = """
    
    """
    image = Image.open(BytesIO(base64.b64decode(base64_icon)))
    # Создаем иконку с меню
    menu = (pystray.MenuItem("View Log", view_log),
            pystray.MenuItem("Open Destination Folder", open_destination_folder),
            pystray.MenuItem("Settings", show_folder_selection_window),
            pystray.MenuItem("Quit", on_quit))
    icon = pystray.Icon("move_files", image, "Move Files", menu=menu)
    return icon

# Проверяем, вызывается ли функция show_folder_selection_window() только при запуске скрипта напрямую
if __name__ == "__main__":
    threading.Thread(target=periodic_move_files).start()  # Запускаем поток периодического перемещения файлов
    show_main_window()  # Отображаем основное окн
